export default function Login() {

    useEffect(() => {
        document.title += " | Connexion"
    }, [])

    return (
        <div>
            <h2>Login</h2>
            <p>
                <input type="text" placeholder="Nom d'utilisateur ou email"/>
                <label htmlFor=""></label>
            </p>
            <p>
                <input type="password" placeholder="Mot de passe"/>
                <label htmlFor=""></label>
            </p>
        </div>
    )
}
